import * as React from 'react';

const renderIcon = (icon) => {
  switch (icon) {
    case 'clock':
      return (
        <div className='w-12 h-12'>
          <img
            src='https://a0.muscache.com/pictures/788cdf62-dc3a-4149-ac0e-b37909436319.jpg'
            className='w-full h-full'
          />
        </div>
      );
  }
};

export const ControlHostingCard = ({ icon, title, description, link }) => {
  return (
    <div className='w-1/2 mb-16'>
      <div className='w-85p'>
        <div>{renderIcon(icon)}</div>
        <div className='mt-3 mb-2'>
          <h3
            style={{ fontFamily: 'airbnb-bold' }}
            className='text-2xl text-gray-750'>
            {title}
          </h3>
        </div>
        <div>
          <p style={{ fontFamily: 'airbnb-book' }} className='text-gray-750'>
            {description}
          </p>
        </div>
        {link ? (
          <div className='mt-4'>
            <a style={{ fontFamily: 'airbnb-book' }} className='text-green-850'>
              Learn about making money on Airbnb
            </a>
          </div>
        ) : null}
      </div>
    </div>
  );
};
